import React from 'react';

function FrontPage({ onSelectNumber }) {
  return (
    <div className="front-page">
      <h1>Select a Times Table to Practice</h1>
      <div className="number-selection">
      {[...Array(11).keys()].map(i => {
          const number = i + 2; // Generates numbers 2 through 12
          return (
            <button key={number} onClick={() => onSelectNumber(number)}>
              {number}
            </button>
          );
        })}
      </div>
    </div>
  );
}

export default FrontPage;
